  02> WILLIAMS, Jane Elizabeth m on 15.02.1849 to WILLIAMS, Henry
  b 23.10.1827 d 27.05.1902
  b 10.11.1823 d 06.12.1907
  Jane b. at Paihia and d. at Pakaraka. Henry, slo Henry Williams and Marianne Coldham. The
  biographies and descendants of Jane and Henry are listed under Henry's entry in this Family
  Tree.
  03> WILLIAMS, William Leonard m on 06.06.1853 to WANKLYN, Sarah
  b 22.07.1829 d 24.08.1916
  b 09.05.1828 d 18.12.1894
  04> WILLIAMS, Thomas Sydney
  b 09.02.1831 d 11.06.1847
